          example: <snowflake>
        - name: rule_id
          in: path
          schema:
            type: string
          required: true
          description: '(Required) '
          example: <snowflake>
      responses:
        '200':
          description: OK
          headers:
            Content-Type:
              schema:
                type: string
                example: text/plain
          content:
            text/plain:
              schema:
                type: string
              example: ''
    patch:
      tags:
        - AutoMod
