        - name: rule_id
          in: path
          schema:
            type: string
          required: true
          description: '(Required) '
          example: <snowflake>
      responses:
        '200':
          description: OK
          headers:
            Content-Type:
              schema:
                type: string
                example: text/plain
          content:
            text/plain:
              schema:
                type: string
              example: ''
  /guilds/{guild_id}/auto-moderation/rules:
    get:
      tags:
        - AutoMod
      summary: list auto moderation rules
      parameters:
        - name: guild_id
          in: path
          schema:
            type: string
          required: true
          description: '(Required) '
