          in: query
          schema:
            type: string
          example: <string,null-snowflake>
        - name: action_type
          in: query
          schema:
            type: string
          example: <integer,null>
        - name: before
          in: query
          schema:
            type: string
          example: <string,null-snowflake>
        - name: after
          in: query
          schema:
            type: string
          example: <string,null-snowflake>
        - name: limit
          in: query
          schema:
            type: string
          example: <integer,null>
        - name: guild_id
          in: path
          schema:
            type: string
          required: true
          description: '(Required) '
          example: <snowflake>
      responses:
        '200':
          description: OK
          headers:
            Content-Type:
              schema:
                type: string
                example: text/plain
          content:
            text/plain:
              schema:
                type: string
